// Componentes HTML
const titulo = '<h1> Encuentra la maquina que necesitas </h1>'




const data = [
  { column0: "Producto 1",   column1: "A1", column2: "A2", column3: "A3", column4: "A4" , column5: "A5"}

]



function App() {
  return (

    <div className="App">
      <h1> Hola </h1>
      <table>
        <tr>
          <tr>Datos</tr>
          <th><img src={require('./img/1.png')} alt="Logo" /> </th>
          <th><img src={require('./img/2.png')} alt="Logo" /> </th>
          <th><img src={require('./img/3.png')} alt="Logo" /> </th>
          <th><img src={require('./img/4.png')} alt="Logo" /> </th>
          <th><img src={require('./img/5.png')} alt="Logo" /> </th>
          <th><img src={require('./img/6.png')} alt="Logo" /> </th>
          <th><img src={require('./img/7.png')} alt="Logo" /> </th>
          <th><img src={require('./img/8.png')} alt="Logo" /> </th>
          <th><img src={require('./img/9.png')} alt="Logo" /> </th>
        </tr>

        {data.map((val, key) => {
          return ( // no Entiendo muy bien como funciona esta parte
            <tr key={key}>
              <td>{val.column0}</td>
              <td>{val.column1}</td>
              <td>{val.column2}</td>
              <td>{val.column3}</td>
              <td>{val.column4}</td>
              <td>{val.column6}</td>
              <td>{val.column7}</td>
              <td>{val.column4}</td>

            </tr>
          )
        })}
      </table>
    </div>
  );
}

export default App;
